import './main.css';
import {Navb} from './imports';
import "materialize-css";
import { Fragment } from 'react';
import { Container, Row, Col , Navbar, Nav, Button, Card, Alert} from 'react-bootstrap';
function Main() {
  return(
    <Fragment>
      <Navb/>
      <Container fluid>
        <br/>
        <Col>
          <Row>
            <h1> HI HI 1</h1>
          </Row>
          <Row>
            <h1> HIHI 2</h1>
          </Row>

        </Col>
        <Col>
        <Row>
          <h1>test</h1>
        </Row>
        </Col>
      </Container>
    </Fragment>
    
  )
}

export default Main;
